  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Benton Lake National
  Wildlife Refuge outlines Refuge accomplishments during the 1976 calendar year. The
  report begins with an introduction to the Refuge and information about weather conditions,
  habitat conditions, land acquisition activities, and the system status. Construction
  and maintenance are also described. Habitat management is covered; croplands, grasslands,
  wetlands, forests, wilderness areas, and easements for waterfowl management are
  discussed. The wildlife section of the report discusses endangered species, threatened
  species, migratory birds, mammals, and non-migratory birds. Interpretation and recreation
  activities are outlined; topics include fishing, hunting, and law enforcement. Field
  investigations and safety information are attached\",\n\t\"license_title\": \"License
